results.before:
function setBaseAddress(string memory baseUrl)
        public
        onlyOwner
        returns (string memory)
    {
        require(
            bytes(baseUrl).length > 0,
            "Cannot set base address with an invalid 'url'."
        );

        _baseUrl = baseUrl;
        emit BaseUrlChanged(_baseUrl, baseUrl);
        return _baseUrl;
    }

